import Humble from "../../img/humble.png";
import Card from '../Box/Box';


const Services = () => {
  return (
    <div className="services">

        {/* right side */}
        <div className="cards">

            {/* first card */}
            <div style={{top: '2rem',left: '44.5rem'}}>
                <Card
                emoji = {HeartEmoji}
                heading = {'Design'}
                detail = {"Figma, Sketch, Photoshop"}
                />
            </div>

            {/* Second card */}
            <div style={{top: '2rem',left: "-1rem"}}>
                <Card
                emoji = {Glasses}
                heading = {'Machine Learning Engineer'}
                detail = {"HTML, JAVA, CSS"}
                />
            </div>

            {/* first card */}
            <div style={{top: '24rem',left: '44.5rem'}}>
                <Card
                emoji = {HeartEmoji}
                heading = {'Design'}
                detail = {"Figma, Sketch, Photoshop"}
                />
            </div>

            {/* Second card */}
            <div style={{top: '12rem',left: "-1rem"}}>
                <Card
                emoji = {Glasses}
                heading = {'Machine Learning Engineer'}
                detail = {"HTML, JAVA, CSS"}
                />
            </div>






        </div>

    </div>
  )
}

export default Services
